import BlogList from './BlogList';
import Loading from './Loading';
import Error from './Error';
import useFetch from './useFetch';

const Home = () => {
    const { data: blogs, error, isLoading } = useFetch('http://192.168.1.98:5000/blog');

    return (
		<div className="home" onScroll={() => console.log('scrolled')}>
			{error && <Error />}
			{isLoading && <Loading />}
			{blogs && <BlogList blogs={blogs} />}
		</div>
	);
}

export default Home;
